import  React from 'react';
import { BrowserRouter as Router, Switch} from 'react-router-dom';
import RouteNormal  from './Route';
import LayoutHome, {LayoutAdmin}  from './Layout';
import HomePage from './pages/HomePage/HomePage';
import AdminPage from './pages/AdminPage/AdminPage';
import LoginPage from './pages/LoginPage/LoginPage';

const routes = (
    <Router>
        <Switch>
            <RouteNormal path="/" exact component={HomePage} layout={LayoutHome} />
            <RouteNormal path="/admin" component={AdminPage} layout={LayoutAdmin} />
            <RouteNormal path="/login" component={LoginPage} layout={LayoutLo} />
            
        </Switch>
    </Router>
);

export default routes;
